import React from "react";



const SlotM = () =>{
    let x = 3;
    let y = 4;
    let z = 4;

if (x == y && y == z) {
    return 
    (<h1>{x} {y} {z}</h1>,
    "Matching");
}

    else {
        return 
        (<h1>{x} {y} {z}</h1>,
        "Not Matching");
    };
}

const App =()=>{
    return (
        <>

        <h1>Welcome to Slot Machine Game</h1>
        <SlotM />
        </>
    );
}



export default App;
